class Map {
    constructor(context, width, height) {
        this.context = context;
        this.width = width;
        this.height = height;
        this.tileSize = 32;

        this.map = {
            width: this.width * this.tileSize,
            height: this.height * this.tileSize,
            data: []
        };
        this.camera = {
            x: 0,
            y: 0,
            width: 854 * 1,
            height: 480 * 1
        };

        this.mapCanvas = document.querySelector("#GameMap");
        this.mapCanvas.width = this.map.width;
        this.mapCanvas.height = this.map.height;
        this.mapCanvas.style.width = this.map.width;
        this.mapCanvas.style.height = this.map.height;

        this.gameCanvas = document.querySelector("#GameBoard");
        this.gameCanvas.width = this.camera.width;
        this.gameCanvas.height = this.camera.height;
        this.gameCanvas.style.width = this.map.width;
        this.gameCanvas.style.height = this.map.height;

        this.generateMap();
        this.drawMap()
    }

    getGameBoard() {
        return this.gameCanvas;
    }

    getMapCanvas() {
        return this.mapCanvas;
    }

    generateMap() {
        let element = document.querySelector("#GameMap");
        this.map.data = []

        for (let r = 0; r < this.height; r++) {
            let rows = []
            for (let c = 0; c < this.width; c++) {
                rows.push(mapData[r * this.width + c]);
            }
            this.map.data.push(rows);
        }
    }

    drawMap() {
        /*
         * วาดแผนที่ ลงไปใน canvas
         */

        // Legacy
        /*
        this.context.save();
        this.context.fillStyle = "#1e7c3e";
        this.context.fillRect(0, 0, this.width, this.height);
        this.context.restore();
        */

        let context = this.mapCanvas.getContext("2d");
        let tileset = new Image();
        tileset.src = "./assets/map.png";
        let tileSize = this.tileSize;
        let map = this;
        tileset.onload = function () {
            context.drawImage(tileset, 0, 0, game.map.map.width, game.map.map.height)
            /*
            for (let r = 0; r < map.height; r++) {
                for (let c = 0; c < map.width; c++) {
                    if (map.map.data[r][c]) {
                        let image_y = Math.floor(map.map.data[r][c] / 32) * 8;
                        let image_x = game.map.map.data[r][c] % 32 * 8;
                        console.log(image_x, image_y)
                        context.drawImage(tileset, image_x, image_y, 8, 8, c * tileSize, r * tileSize, tileSize, tileSize);
                    } else {
                        tile = "#000";
                        context.fillStyle = tile;
                        context.fillRect(c * tileSize, r * tileSize, tileSize, tileSize);
                    }
                }
            }*/
        }
    }

    updateCamera() {
		/*
		 * อัพเดตกล้อง ให้เคลื่อนที่ตามตัวละคร
		 * (Not finished / Can't used)
		 *
		 */
        this.camera.x = game.character.x + game.character.width / 2 - this.camera.width / 2;
        this.camera.y = game.character.y + game.character.height / 2 - this.camera.height / 2;
        this.renderCamera();
    }

    renderCamera() {
        let gameBoard = game.getContext("2d");

        gameBoard.drawImage(this.mapCanvas, this.camera.x, this.camera.y, this.camera.width, this.camera.height, 0, 0, this.camera.width, this.camera.height);
        //gameBoard.drawImage(tileset, this.camera.x, this.camera.y, this.camera.width, this.camera.height, 0, 0, this.camera.width, this.camera.height);
    }

    isWalkable(x, y) {
        let c = Math.floor(x / this.tileSize);
        let r = Math.floor(y / this.tileSize);
        if (c >= 0 && c < this.width && r >= 0 && r < this.height) {
            if (this.map.data[r][c] != 0) {
                return true;
            }
        }
        return false;
    }
}

var tileMapping = {
    "0": "#000",
    "1": "#DDD",
    "2": "#CCC",
    "3": "#BBB",
    "4": "#AAA",
    "5": "#F99"
}

function randomColor(tone = "Red") {
	/*
	 * Random สี
	 */
    colorCode = "0123456789ABCDEF"
    color = "#"
    for (let i = 0; i < 3; i++) {
        if (i == 0 && tone === "Red") {
            color += "F" + colorCode[Math.floor(Math.random() * 16)]
        } else if (i == 1 && tone === "Green") {
            color += (Math.random() >= 0.5 ? "F" : "E") + colorCode[Math.floor(Math.random() * 16)]
        } else if (i == 2 && tone === "Blue") {
            color += "F" + colorCode[Math.floor(Math.random() * 16)]
        } else {
            color += colorCode[Math.max(2, Math.floor(Math.random() * 13))] + colorCode[Math.floor(Math.random() * 16)]
        }
    }
    return color
}

